        outputElementId: mOpt('outputElementId', null, null),
        statusElementId: mOpt('statusElementId', null, null),
        progressElementId: mOpt('progressElementId', null, null),
        logElementId: mOpt('logElementId', null, null),
        totalMemory: mOpt('totalMemory', 268435456, 0),
