            var c = Module["Settings"].CoreToken;
            var p = null;
            var lookupFile = null;
            try {
                lookupFile = FS.lookupPath('/viewer/' + urlToken, { parent: false });
            } catch(e) {
            }

            if (!lookupFile) {
                //throw error
            } else {
                p = Module.ccall('jDVLCore_LoadScene', 'number', ['string', 'string', 'string'], [c, 'file://viewer/' + urlToken, optionalPassword]);
            }
