//Note: If you create the Dvl object yourself and do not specify a 
//totalMemory then Dvl willl default to 256MB - which may not be enough for your application
//The start memory value must be a multiple of 64MB
Dvl["Create"] = function(canvasId, initCanvas, opts) {
    var dvl;
    //Detect if we are on an android device
    var isIOS =  (window.navigator &&  window.navigator.userAgent.toLowerCase().indexOf('ipad') > -1 );
    var isAndroid = (window.navigator.userAgent.toLowerCase().match(/android/g) ? true : false);
    var is_chrome = (window.navigator &&  window.navigator.userAgent.toLowerCase().indexOf('chrome') > -1); 
    var is_explorer = (window.navigator &&  window.navigator.userAgent.toLowerCase().indexOf('msie') > -1); 
    var is_firefox = (window.navigator &&  window.navigator.userAgent.toLowerCase().indexOf('firefox') > -1);
    var is_safari = (window.navigator &&  window.navigator.userAgent.toLowerCase().indexOf('safari') > -1); 
    var is_Opera = (window.navigator &&  window.navigator.userAgent.toLowerCase().indexOf('presto') > -1);
    var iTryForMem  = 2048 * 1024 * 1024; 
    var iTryForMemRatio = 3; 
    var iTryForStepDown = 8 * 1024 * 1024;
    var bStopTrying = false;
    
    if ((is_chrome)&&(is_safari)) {is_safari=false;}

    //Set a flag to let the core know that we are using Create() rather than new Dvl...
    opts.instanceCreateUsed = true;

    //If the consumer has set a totalMemory value then we accept this and create the object with this value
    if (opts.totalMemory != null && (opts.totalMemory != "" || opts.totalMemory != 0)) {
    	console.log("Explicit Memory Allocation: totalMemory(" + opts.totalMemory + ")");  
    	dvl =  new Dvl(canvasId, initCanvas, opts);
    };

    //Set some defaults for different browsers
    if (isAndroid) { //Device limitations 	
        opts.totalMemory = 268435456; //256MB
        bStopTrying = true; //Just use 256 don't try and guess 
        console.log("isAndroid: totalMemory(" + opts.totalMemory + ")");
    } else if(isIOS) {
            
            if (window.devicePixelRatio && window.devicePixelRatio > 1){
                iTryForMem = 68157440; //75497472 (Not very stable); //67108864; //67108864; //33554432; //Start lower for iOS because we only have about 10 seconds to figure this out http://stackoverflow.com/questions/22039534/ios-browser-crashes-due-to-low-memory
            }
            else {
                iTryForMem = 60118357; //Pushing Limit //44739242; //22369621;
                opts.totalMemory = iTryForMem * iTryForMemRatio;
                bStopTrying = true; //Just use 256 don't try and guess 
            }

            iTryForStepDown = 2 * 1024 * 1024; //Step down faster to speed things up   
            console.log("iOS: iTryForMem(" + iTryForMem * iTryForMemRatio + ")");
    }
    else
        {
            if(is_firefox)
                {
            		console.log("firefox: reduce try for mem ratio to 2");
                    iTryForMemRatio = 2; 
                }
        }

    //If a memory allocation algorythm has been supplied then execute it to determine the totalMemory. Otherwise execute the default
    if(opts.memoryCalculation)
    {
    		console.log("memoryCalculation set - use this");
        opts.totalMemory = opts.memoryCalculation();
    }
    else if(dvl==null)
    {
        //If the consumer has not provided a value for totalMemory we run through a step-down (in 64MB blocks) 
        //loop attempting to create an instance of the core starting with 1024MB
        window.jdvl_a_test = null;
        while (!bStopTrying && iTryForMem>0) {
            try{
                (function(){    // what is maximum size of memory allocated for float32 array 
                    window.jdvl_a_test = new Float32Array(iTryForMem);
                    window.jdvl_a_test = undefined;
                    delete window.jdvl_a_test;
                    //If we actually get the memory we are after then destroy the array and try and garbage collect 
                    if(window["CollectGarbage"]) //IE Only
                        {
                            CollectGarbage();
                        }
                    
                    bStopTrying = true; //It succeeded
                    opts.totalMemory = iTryForMem*iTryForMemRatio; 
                })();
            }
            catch(e)
            {
               iTryForMem = iTryForMem - iTryForStepDown;
               bStopTrying = false;
            }
            finally
            {
                window.jdvl_a_test = null;
                delete window.jdvl_a_test;
            }
        }    
    };

    if(window.console){
            console.log("jDVL: Attempting to initialise using: %d bytes.", opts.totalMemory);
    }

    while (dvl == null && opts.totalMemory > 0) {
    	  console.log("Attempt step down memory allocation with totalMemory: " + opts.totalMemory);
        try {
            dvl = new Dvl(canvasId, initCanvas, opts);
        } catch (e) {
            if (e == DvlEnums.CONFIGERR.CONFIGERR_COULDNOTCREATECONTEXT) {
                throw (e);
            } else if (e.message == "Invalid typed array length" || e.message == "Invalid array buffer length") {
                if (console) {
                    console.log(e.message + ":" + opts.totalMemory);
                }
                opts.totalMemory = opts.totalMemory - 1048576; //1048576; //67108864;
            } else {
                console.log("ERROR CREATING DVL");
                console.log(e);
                throw (e);
            }
        }
    };
    
    if(dvl)
        {
    		console.log("jDVL: Initialised with " + opts.totalMemory + " bytes of memory. Attempting configuration.");
            //Setup canvas and initialise core
            if (dvl.startupOptions.initCanvas) {
            dvl.Helpers.SetVideoMode(0, 0, 24, 0); //Create context with current canvas size
            dvl.CreateCoreInstance();
            dvl.Settings.CoreToken = dvl.Settings.CoreToken;
            dvl.Settings.MajorVersion = dvl.Core.GetMajorVersion();
            dvl.Settings.MinorVersion = dvl.Core.GetMinorVersion();
              
             var icr = dvl.Core.Init(dvl.Settings.MajorVersion, dvl.Settings.MinorVersion);
             if (icr == 1) {
                    try{
                        irr = dvl.Core.InitRenderer();
                        if (irr == 1) {
                            dvl.Settings.RendererToken = dvl.Core.GetRendererPtr();
                            dvl.Settings.Initialised = true;
                        }else {
                             throw ("jDVLCore_InitRenderer failed with DVLRESULT:" + irr);
                        }  
                    }catch(e){ 
                        irr = dvl.Core.InitRenderer();
                        if(irr==3 || irr==1){
                            dvl.Settings.RendererToken = dvl.Core.GetRendererPtr();
                            dvl.Settings.Initialised = true;
                        } 
                    }
                } else {
                    throw ("jDVLCore_Init failed with DVLRESULT:" + icr);
                }
            }
        
            if (dvl.startupOptions.configureCanvas) {
                dvl.Helpers.ConfigureCanvas(dvl.startupOptions.width, dvl.startupOptions.height, dvl.startupOptions.depth, dvl.startupOptions.flags);
                var cm = dvl.startupOptions.bgColorMatrix;
                dvl.Renderer.SetBackgroundColor(cm[0], cm[1], cm[2], cm[3], cm[4], cm[5]);
                dvl.Helpers.SetRenderLoop(true);
            };
        }

    dvl.FS_createFolder("/", "viewer", true, true);
    return dvl;
};
